import React from 'react';
import { LanguageProvider } from './context/LanguageContext';
import AppContent from './AppContent';
import MobileTest from './components/MobileTest';
import './App.css';

function App() {
  return (
    <LanguageProvider>
      <AppContent />
      <MobileTest />
    </LanguageProvider>
  );
}

export default App;
